import React,{Component} from 'react';

export class Machine extends Component{

    constructor(props) {
        super(props);
        console.dir(props);      
        this.state = {
          machine: props.match.params.id || 'unknown'
        }
      }

    render(){
        return(
            <div>
                <h3>{this.props.match.params.id}</h3>
            </div>
        )
    }
}
